new Promise(((e,t)=>{projects?e():t("Filters element do not exist")})).then((e=>{for(let e of projects)document.getElementById("grid").innerHTML+='<div>    <a class="'+e.filters+' js-link--content"    href="'+e.href+'"    aria-label="'+e.label+'"    data-template="'+e.templatePath+'"    target="_top">    '+e.name+"    </a></div>"}),(e=>{})).finally((()=>moduleRouter.linksListener("js-link--content")));